import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // 1. Rapidly add multiple items to the cart
    const addToCartButtons = await page.locator('button.add-to-cart').all();
    if (addToCartButtons.length < 5) {
      throw new Error('Could not find enough "Add to Cart" buttons to perform the test.');
    }
    // Click the first 5 buttons in quick succession
    for (let i = 0; i < 5; i++) {
      await addToCartButtons[i].click();
    }

    // Wait for notifications to disappear to not obstruct the view
    await page.waitForTimeout(3500);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // 2. Open the cart modal
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_view.png'));

    // 3. Manipulate items in the cart
    // Increase quantity of the first item
    const firstItem = page.locator('.cart-item').first();
    await firstItem.locator('.quantity-btn').last().click(); // Click '+'
    await firstItem.locator('.quantity-btn').last().click(); // Click '+' again

    // Decrease quantity of the second item
    const secondItem = page.locator('.cart-item').nth(1);
    await secondItem.locator('.quantity-btn').first().click(); // Click '-'

    // Remove the third item
    const thirdItem = page.locator('.cart-item').nth(2);
    await thirdItem.locator('button.remove-item').click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_manipulated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_manipulated.png'));

    // 4. Extract final cart count
    const finalCartText = await page.locator('div.cart').textContent();
    const cartCount = finalCartText.trim().split('\n')[0];

    return {
      success: true,
      action: "Rapidly added 5 items, opened cart, increased quantity for one, decreased for another, and removed one item.",
      extractedData: {
        initialItemsAdded: 5,
        finalCartCount: cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to perform rapid cart manipulation stress test",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
